import React from 'react'
import Header from './Component/Header/Header';
import style from './style.css';
import Latest from './Component/Latest/Latest';
import Article from './Component/LatestArticle.jsx/Aarticle';
import MainArticle from './Component/LatestArticle.jsx/MainArticle/MainArticle';
import Home from './Component/Home/Home/Home';
import LatestStories from './Component/LatestStories/LatestStories';
import Stories from './Component/Stories/Stories';
import Footer from './Component/Footer/Footer';
import Bollywood from './Component2/Bollywood/Bollywood';

function App() {
  return (
  <> 
  <Header/>
  <Home/> 
  <Latest/>
  <MainArticle/>
  <Stories/>
  <Footer/> 
  <Bollywood/>
  </>
  )
}

export default App;
